import SignIn from "./pages/home-page";

function App() {
  return (
    <ThemeProvider theme={theme}>
      {/* <Typography variant="h1">Hello World</Typography> */}
      <SignIn></SignIn>
    </ThemeProvider>
  );
}

export default App;
